        <iframe width="100%" height="80%" frameborder="0" scrolling="no" marginheight="0" marginwidth="0" src="https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d14460.992694779456!2d26.046799052804705!3d44.43765202290675!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x40b201ea132d5141%3A0xf5d5aecb94fa6dc7!2sUniversitatea%20POLITEHNICA%20din%20Bucure%C8%99ti!5e0!3m2!1sro!2sro!4v1657619152112!5m2!1sro!2sro"></iframe>

    </div>
    </div>
    
  )
}

export default About
